<!DOCTYPE html>
<html lang="en">
<head>
        <link href="data:image/png;base64," rel="icon">
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Rental Mobil - Unit</title>
    <style>
        body {
            font-family: Arial, sans-serif;
            display: flex;
            flex-wrap: wrap;
            justify-content: center;
            padding: 20px;
            background-image: url('https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQpJBVp3KBjlqMJ1RLFnrwsir4-pKRP8QgMVg&s');
        }
        .card {
            background: #fff;
            border-radius: 15px;
            width: 250px;
            margin: 15px;
            overflow: hidden;
            box-shadow: 0 4px 8px rgba(0, 0, 0, 0.2);
            position: relative;
            transition: transform 0.3s ease, box-shadow 0.3s ease;
        }
        .card:hover {
            transform: scale(1.05);
            box-shadow: 0 8px 16px rgba(0, 0, 0, 0.3);
        }
        .card img {
            width: 100%;
            height: auto;
            display: block;
        }
        .card-content {
            padding: 15px;
        }
        .card-content h3 {
            margin-top: 0;
            font-size: 1.2em;
            color: #333;
        }
        .card-content p {
            margin: 0;
            font-size: 1em;
            color: #666;
        }
        .copy-icon {
            position: absolute;
            top: 10px;
            right: 10px;
            cursor: pointer;
        }
        .copy-icon i {
            font-size: 1.5em;
            color: #007bff;
        }
        .copy-icon i:hover {
            color: #0056b3;
        }
        .center-card {
            display: flex;
            justify-content: center;
            align-items: center;
            flex-direction: column;
            margin-top: 40px; /* Space between the cards */
        }
        .center-card-content {
            text-align: center;
            padding: 20px;
            background: #fff;
            border-radius: 15px;
            width: 400px; /* Increased width */
            box-shadow: 0 4px 8px rgba(0, 0, 0, 0.2);
        }
        .center-card-content h3 {
            margin-top: 0;
            font-size: 1.5em; /* Increased font size */
            color: #333;
        }
        .center-card-content p {
            margin: 10px 0;
            font-size: 1.1em; /* Increased font size */
            color: #666;
        }
        .button {
            background-color: #007bff;
            color: #fff;
            border: none;
            border-radius: 5px;
            padding: 10px 15px;
            font-size: 1em;
            cursor: pointer;
            transition: background-color 0.3s ease;
        }
        .button:hover {
            background-color: #0056b3;
        }
    </style>
</head>
<body>
    <div class="card">
        <div class="copy-icon" onclick="copyText(this)">
            <i class="fas fa-copy"></i>
        </div>
        <img src="data:image/jpeg;base64," alt="Image 1">
        <div class="card-content">
            <h3>Fortuner</h3>
            <p>data:image/jpeg;base64,</p>
        </div>
    </div>

    <div class="card">
        <div class="copy-icon" onclick="copyText(this)">
            <i class="fas fa-copy"></i>
        </div>
        <img src="data:image/jpeg;base64," alt="Image 2">
        <div class="card-content">
            <h3>Avanza</h3>
            <p>data:image/jpeg;base64,</p>
        </div>
    </div>

    <div class="card">
        <div class="copy-icon" onclick="copyText(this)">
            <i class="fas fa-copy"></i>
        </div>
        <img src="data:image/jpeg;base64," alt="Image 3">
        <div class="card-content">
            <h3>Rush</h3>
            <p>data:image/jpeg;base64,</p>
        </div>
    </div>

    <div class="card">
        <div class="copy-icon" onclick="copyText(this)">
            <i class="fas fa-copy"></i>
        </div>
        <img src="data:image/jpeg;base64," alt="Image 4">
        <div class="card-content">
            <h3>Ayla</h3>
            <p>data:image/jpeg;base64,</p>
        </div>
    </div>

    <div class="card">
        <div class="copy-icon" onclick="copyText(this)">
            <i class="fas fa-copy"></i>
        </div>
        <img src="data:image/jpeg;base64," alt="Image 5">
        <div class="card-content">
            <h3>Yaris</h3>
            <p>data:image/jpeg;base64,/9j/4AAQSkZJRgABAQAAAQABAAD/2wCEAAkGBxMSEhUUEhIWFhUXFxYYGRUWGBoZFxgWFxYXFxUVFhgZHSggGBomGxYWITEhJSkrLi4uFx8zODMtNy    </p>
        </div>
    </div>

    <div class="center-card">
        <div class="center-card-content">
            <h3>Kualitas Mobil</h3>
            <p>Mobil kami memiliki kualitas terbaik dengan fitur canggih dan performa yang sangat memuaskan. Pilih mobil impian Anda sekarang dan rasakan sendiri keunggulannya!</p>
            <button class="button" onclick="goBack()">Kembali</button>
        </div>
    </div>

    <script src="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.0.0-beta3/js/all.min.js"></script>
    <script>
        function copyText(element) {
            // Find the card that contains the clicked icon
            const card = element.closest('.card');
            // Find the text in the <p> element within that card
            const text = card.querySelector('.card-content p').textContent;
            
            // Copy the text to the clipboard
            navigator.clipboard.writeText(text).then(() => {
                alert('Text copied to clipboard!');
            }, (err) => {
                console.error('Failed to copy text: ', err);
            });
        }

        function goBack() {
            window.history.back();
        }
    </script>
</body>
</html>
